import React from 'react';
import './navbar.css';
import logo from '../../assets/logo.png';
import contactImg from '../../assets/th (5).png'
import {Link} from 'react-scroll';
import Menu from '../../assets/th (4).png'

const Navbar = () => {
    return(
       <nav className='navbar'>
        <img src={logo} alt="logo" className='logo'/>
        
        <div className='desktopMenu'>
        <Link activeClass='active' to="home" smooth={true} duration={500} spy={true} offset={-100} className='link desktopMenuListItem'>Home</Link>
          <Link activeClass='active' to="about" smooth={true} duration={500}  spy={true} offset={-100} className='link desktopMenuListItem'>About</Link>
          <Link activeClass='active' to="portfolio" smooth={true} duration={500} spy={true} offset={-100} className='link desktopMenuListItem'>Portfolio</Link>
          <Link activeClass='active' to="clients" smooth={true} duration={500} spy={true} offset={-100} className='link desktopMenuListItem'>Clients</Link>
        </div>
         
    
       <button className='desktopMenuBtn' onClick ={() => {
        const[showMenu,setShowMenu]= useState(false);
        document.getElementById('contact').scrollIntoView({behaviour:'smooth'});
       }}>
        <img src={contactImg} alt='Contact icon' className='desktopMenuImg'/>Contact Me</button>
        
        <img src={Menu} alt="Menu" className='mobMenu'/>
        
        <div className='navMenu'>
        <Link activeClass='active' to="home" smooth={true} duration={500} spy={true} offset={-100} className='ListItem'onClick={()=>setShowMenu(showMenu)} >Home</Link>
          <Link activeClass='active' to="about" smooth={true} duration={500}  spy={true} offset={-100} className='ListItem'>About</Link>
          <Link activeClass='active' to="portfolio" smooth={true} duration={500} spy={true} offset={-100} className='ListItem'>Portfolio</Link>
          <Link activeClass='active' to="clients" smooth={true} duration={500} spy={true} offset={-100} className='ListItem'>Clients</Link>
          <Link activeClass='active' to="Contact" smooth={true} duration={500} spy={true} offset={-100} className='ListItem'>Contact</Link>
        </div>
       </nav>
    );
}

export default Navbar
